using System;
using System.Collections.Generic;
using System.Data.Entity;
using System.Linq;
using System.Threading.Tasks;

namespace AdServiceApi.Models
{
    public class AdDbInitializer : DropCreateDatabaseAlways<AdContext>
    {
        protected override void Seed(AdContext context)
        {
            context.Ads.Add(new AdModel { Name = "Отдам собаку в добрые руки", Description = "Ласковая собака ищет семью", DateTime = DateTime.Now, Price = 0, Photo = "" });
            base.Seed(context);
        }
    }
}
